import React from "react";
import { HashRouter } from 'react-router-dom';
import App from "./App";

class Router extends React.Component {
    render(){
        return (
            <HashRouter basename="/" hashType="noslash">
               <App />
            </HashRouter>
        )
    }
}

export default Router;
